The Bears have made their decision. And the incumbent has fended off the Super Bowl LII MVP.

Per a source with direct knowledge of the decision, Mitch Trubisky will serve as the Bears‚Äô starting quarterback entering the 2020 season.

Trubisky, in the estimation of the coaching staff, stepped up and improved the way the team wanted him to. He has matured a lot, the source explained, and he won a fair and healthy competition between Trubisky and newcomer Nick Foles.

The Bears regard Foles as a valuable asset, both as it relates to helping Trubisky continue to improve and as it relates to being ready to play, if Trubisky is injured ‚Äî or if he struggles to the point where a change becomes necessary. Foles knows the offense well, which will make it easier for him to get ready to play, if/when that becomes necessary.

